import React from 'react'

function Products() {
    const hello = async () => {
        const getData = await fetch('https://fakestoreapi.com/products');
        const res = await getData.json();
        console.log(res)
    }
  return (
    <div className='products'>
        <div className='heading'>
            <h2>All Products</h2>
            </div>
        </div>
  )
}

export default Products
